import React from 'react';
import "./Train.css";

export default function Train(props) {
    const { trainData } = props;

    let onTime = "On time";
    if (trainData.DELAY !== "T0S") {
        onTime = "DELAYED";
    }

    function lowerCase(station) {
        return station.toLowerCase().replace(/\b\w/g, c => c.toUpperCase());
    }

    return (
        <div className="all">
            <div id="bothSides">
                <img id="icon" src="/images/capitalM"></img>
                <div id="allInfo">
                    <div id="info">
                        <div id="location">
                            <div id="station1">{lowerCase(trainData.STATION)}</div>
                            <img id="arrow" src="/images/arrow.jpg"></img>
                            <div id="station2">{lowerCase(trainData.DESTINATION)}</div>
                        </div>
                        <div id="bottomInfo">
                            <div id="lineColor">{lowerCase(trainData.LINE)}</div>
                            <p id="onTime">{}</p>
                        </div>
                    </div>
                    <div id="time">
                        <p id="num">{trainData.WAITING_TIME.split(" ")[0]}</p>
                        <p id="mins">{trainData.WAITING_TIME.split(" ")[1]}</p>
                    </div>
                </div>
            </div>
        </div>
    );
}
